import React,{useState,useEffect} from 'react';
import {
  View,
  Text,
  Linking 
} from 'react-native';
function Succsess() {
  return (
    <View>
      <Text className="icon">
        Succuss
      </Text>
      <Text className="icon">
        Thank You for your order!
      </Text>
      <Text className="icon">
        If you have any questions, please email

      </Text>
      <Text style={{color: 'blue'}}
      onPress={() => Linking.openURL('mailto')}>
  Google
</Text>
      <Text className="icon">
        Succuss
      </Text>
    </View>
  )
}

export default Succsess;
